(32904, 97623, 0, 1, '來跳舞吧!', '2011年第一首創作。\r\n\r\n情人節室友們都去約會了，只好在家彈琴囉～\r\n\r\n不知道聽起來會不會有些老派? 哈', '2011-02-15 00:00:00', 2000, 0, 2, 3, '', '', 199, '', 'Jessica', '', 'Jessica', '', '', 0, 1, 0, '2011-02-15 23:02:01', '2015-03-12 13:45:59', '0000-00-00 00:00:00'),
