(32906, 58535, 0, 1, '收心操', '開學前優秀學子們點播第一名的歌曲，收心操。', '2010-09-06 00:00:00', 2000, 0, 1, 4, '暑假過的正悠閒\r\n你卻跑來說快要開學\r\n天真如我　哪還記得\r\n學校怎麼走\r\n\r\n天空上白雲片片\r\n好想就這麼漂到ＨＡＷＡＩ\r\n但該來的　還是會來\r\n只好大聲唱\r\n\r\n開學好開心　開學好開心\r\n我最喜歡上學吸收新知識\r\n\r\n開學好開心　開學好開心\r\n第一周考試根本叫我去死\r\n\r\n開學好開心　開學好開心\r\n一到五都有課實在很充實\r\n\r\n開學好開心　開學好開心\r\n啦啦啦啦啦啦啦啦', '', 171, '', '小尾巴', '小尾巴', '小尾巴', '', '', 0, 1, 0, '2011-02-15 23:39:59', '2015-03-12 13:45:59', '0000-00-00 00:00:00'),
(32907, 97623, 0, 1, '不完美也是好的', '最初的版本是非常抒情的鋼琴曲\r\n\r\n但每次都一樣就老套了啊～ 哈\r\n\r\n加入了一點節奏 我喜歡最後一段打過門的地方\r\n\r\n', '2010-09-15 00:00:00', 2000, 0, 2, 12, '', '', 259, '', 'Jessica', '', 'Jessica', '', '', 0, 0, 1, '2011-02-15 23:59:50', '2013-10-07 17:18:06', '0000-00-00 00:00:00'),
(32908, 97623, 0, 1, '忍痛', '回歸純鋼琴路線。\r\n\r\n這次很快就完成了，可能是下午我看了一段影片。\r\n\r\n影片裡的人很深情的在唱歌，當下就把那心情化成音樂。\r\n\r\n', '2010-05-24 00:00:00', 2000, 0, 2, 17, '', '', 302, '', 'Jessica', '', 'Jessica', '', '', 0, 1, 0, '2011-02-16 00:14:10', '2015-03-12 13:45:59', '0000-00-00 00:00:00'),
