(32913, 97623, 0, 1, '終於', '取名為"終於"純粹是終於完成了 哈\r\n\r\n基本的旋律，在高中的時候就寫好了，只是不完整所以就一直擱著。\r\n\r\n說也奇怪，在今年暑假的時候，我花了一個小時就寫好了耶～ \r\n', '2009-09-17 00:00:00', 2000, 0, 2, 17, '', '', 260, '', 'Jessica', '', 'Jessica', '', '', 0, 1, 0, '2011-02-16 00:38:26', '2015-03-12 13:45:59', '0000-00-00 00:00:00'),
(32914, 97623, 0, 1, '值得紀念的一刻', '人生中第一首完整的創作曲。\r\n\r\n希望這首輕鬆的小品，讓每個人都有好心情 ：)\r\n\r\n歡迎大家給我意見，我會繼續努力的!\r\n\r\n', '2009-04-10 00:00:00', 2000, 0, 2, 7, '', '', 197, '', 'Jessica', '', 'Jessica', '', '', 0, 1, 0, '2011-02-16 00:54:24', '2015-03-12 13:45:59', '0000-00-00 00:00:00'),
(32915, 61040, 0, 1, '貓眼(demo)', '', '2011-02-16 00:00:00', 2000, 0, 2, 7, '閉上眼   誰都不被誰看見\r\n\r\n繞個圈   她裙襬撫過床沿\r\n\r\n高跟鞋   在波斯地毯纏綿\r\n\r\n迷濛間   此刻你為誰暈眩\r\n\r\n \r\n\r\n慾望  若隱  若現\r\n\r\n迷幻  絕艷  緋夜\r\n\r\n倨傲的誘惑在胸口燃燒刺痛讓你難忍試煉\r\n\r\n你為求她的垂愛願意順從她所有任性差遣...\r\n\r\n \r\n\r\n攀上肩   髮香在耳邊廝繾\r\n\r\n瞇眼簾   你低頭微笑沉醉\r\n\r\n窗紗前   分不清嬌憐虛偽\r\n\r\n推開臉   野貓一般的戲謔\r\n\r\n \r\n\r\n裸足  漫舞  旖魅\r\n\r\n髮際　香汗  蔓延　\r\n\r\n無法抵抗束手任黑色蕾絲纏繞你想像空間\r\n\r\n溫潤耳語緊繃感官神經蓄勢就像蒼鷹盤旋...\r\n\r\n \r\n\r\n火熱  吻過  指尖\r\n\r\n理智  淪陷  崩潰\r\n\r\n雕鏤鏡臺看見道德凐滅在你心中那黑暗面\r\n\r\n她瞇起貓眼轉身躍開失去興趣對你已不屑...\r\n', '', 231, '', 'kristin', '二爺', '', '', '', 0, 0, 1, '2011-02-16 01:30:28', '2013-10-07 17:18:06', '0000-00-00 00:00:00'),
