(32923, 84478, 0, 1, '還記得嗎?夢想', '記得嗎?最初的夢想', '2011-02-16 00:00:00', 2000, 0, 1, 4, '小時候 夢想 寫在作文紙上\r\n\r\n要當太空人 總統或是音樂家\r\n\r\n班上最漂亮的女生 想把她娶回家\r\n\r\n你記得嗎? 天馬行空 單純的幻想\r\n\r\n \r\n\r\n還繼續尋找嗎?最初的夢想\r\n\r\n地下室福利社 他沒有賣嗎?\r\n\r\n\r\n下課鐘響 看誰先跑到操場\r\n\r\n上課鐘響 時間一下子就過去啦\r\n\r\n \r\n那馬路上天天 都在塞\r\n\r\n塞的不是車 是你自己的心態\r\n\r\n在忙碌生活中 狼狽的記載\r\n\r\n把心情上傳提 供別人欣賞\r\n\r\n隨著科技惰性也隨之而來\r\n\r\n會不會最後連漢堡 都可以下載\r\n\r\n不要忘了電腦發明的意義\r\n\r\n是讓生活便利而不是讓你放棄 \r\n\r\n\r\n \r\n還記得小時候嗎? 還認識自己嗎?\r\n\r\n那個喝著彈珠汽水 跌倒的小鬼\r\n\r\n\r\n還記得小時候嗎? 還認識自己嗎?\r\n\r\n每天盲目的追著   疲憊的活著\r\n\r\n 那個人是誰 \r\n\r\n\r\n\r\n你每天要衝業績 達到你目的\r\n\r\n戴上假面具 得到的獎勵\r\n\r\n有誰知道卸下假面後的笑容\r\n\r\n是不是發自內心最當時的悸動\r\n\r\n\r\n你每天面對老闆 機車的個性\r\n\r\n可 是老闆也有自己的壓力\r\n\r\n有不得已的苦衷 \r\n\r\n我們都習慣放大別人缺點\r\n\r\n卻忘了 先檢討自己\r\n\r\n\r\n紅綠燈閉上眼睛 錯過了 什麼秘密\r\n\r\n人與人之間的關係 少了一種關心\r\n\r\n這城市的冷漠使得我們 開始忘記\r\n\r\n所以我們的眼裡漸漸 都只剩自己\r\n\r\n\r\n想想兒時玩伴 想想學生時代\r\n\r\n想想牙齒還沒長齊那時擁有快樂\r\n\r\n想想畢業旅行 想想營火晚會\r\n\r\n想想你家電錶不再轉動會是怎樣\r\n\r\n\r\n還記得小時候嗎? 還認識自己嗎?\r\n\r\n那個喝著彈珠汽水 跌倒的小鬼\r\n\r\n\r\n還記得小時候嗎? 還認識自己嗎?\r\n\r\n每天盲目的追著   疲憊的活著\r\n\r\n那個人是誰 \r\n\r\n\r\n\r\n有誰知道將來自己會成什麼樣\r\n\r\n有誰知道自己夢想會不會實現\r\n \r\n有誰知道過了十年世界會變怎樣\r\n\r\n我不是大雄 所以我沒有小叮噹\r\n\r\n\r\n但是我知道可以對的起自己良心\r\n\r\n但是我知道夢想需要努力毅力\r\n\r\n我不想知道十年後世界會變怎樣\r\n\r\n我相信有夢想就會 有活著的希望\r\n\r\n\r\n還記得小時候嗎? 還認識自己嗎?\r\n\r\n那個喝著彈珠汽水 跌倒的小鬼\r\n\r\n\r\n還記得小時候嗎? 還認識自己嗎?\r\n\r\n每天盲目的追著   疲憊的活著\r\n\r\n那個人是誰 \r\n\r\n\r\n\r\n請你用心寢聽這世界  請你用力活在這世界\r\n\r\n請你回想起單純的自己 記憶中最初的自己\r\n\r\n', '', 246, '', '陳零九', '陳零九', '陳零九', 'T-Work', '', 0, 0, 1, '2011-02-16 02:12:07', '2013-10-07 17:18:06', '0000-00-00 00:00:00'),
