(32934, 91733, 0, 1, '嗆', '', '2010-07-01 00:00:00', 2000, 0, 1, 1, '暗地說誰是非顛倒    虛偽作做太可笑\r\n雕蟲小技到處炫耀    井底之蛙看不高\r\n拿出本事不要裝屌    和我對決好不好 \r\n沒有對手我好無聊    快快來等你過招\r\n就是嗆   我就是嗆   敢不敢來我設的戰場\r\n就是嗆   我就是嗆    我遇強則強     力量無法阻擋\r\n外表重傷內心激昂    燭火滅了又發亮\r\n不要小看熱血沸揚    呼吸就讓你滅亡\r\n給個機會讓你伸張    多點準備也無妨\r\n我就是我不同凡響    讓我痛   才夠爽  \r\n就是嗆   我就是嗆   敢不敢來我設的戰場\r\n就是嗆   我就是嗆    我遇強則強     力量無法阻擋\r\n\r\n\r\n4          6m     4          6m\r\n捍衛榮譽的領土    維持不敗的紀錄\r\n2m         1/3m/6m  3m   4     3m7\r\n這次就要脫胎換骨    你最好有所覺悟  \r\n', '', 310, '', 'Kevin Wu', 'Kevin Wu', '獨立製作', '', '', 0, 1, 0, '2011-02-16 09:48:45', '2015-03-12 13:46:00', '0000-00-00 00:00:00'),
