(32936, 91733, 0, 1, 'STILL LOVE YOU WHEN I DIE', '', '2009-09-01 00:00:00', 2000, 0, 1, 1, '感覺換化成悲哀   心崩壞難再重來\r\n愛變得像塵埃   虛無縹緲的未來\r\n這樣的愛怎麼愛   不是妳要的就選擇離開\r\n妳需要怎樣的愉快   來修改彼此的對白\r\n奇蹟從不存在   白髮散盡心全都拆開\r\n剩下的全是殘骸   也許是自己不知好歹\r\nTHIS TIME I RALLY CRIED  眼淚竟排山倒海而來   \r\nTHIS TIME I RALLY CRIED  故作姿態來將心掩蓋\r\n\r\nSTILL LOVE YOU WHEN I DIE\r\n傷到徹底竟笑了出來   到底是誰為妳安排\r\n說誰不愛了就先離開\r\nSTILL LOVE YOU WHEN I DIE\r\n有種後悔是千金難買   妳用絕對的感慨\r\n將我推開   STILL LOVE YOU WHEN I DIE\r\n', '', 370, '', 'Kevin Wu', 'Kevin Wu', '獨立製作', '', '', 0, 1, 0, '2011-02-16 09:51:01', '2015-03-12 13:46:00', '0000-00-00 00:00:00'),
