(32955, 98121, 0, 1, '99年臺灣原創流行音樂大獎(首獎)    敗壞社會', '敗壞社會\r\n\r\n這首歌的涵義是要勉勵我們部落的祖人 \r\n不要被社會上負面的事所誘惑 要懂得尊重\r\n懂得飲水思源 不要忘本 不要忘記自己的語言 \r\n更不能忘記自己的文化', '2010-11-24 00:00:00', 2000, 0, 2, 2, '敗壞社會\r\n\r\n如果我門是原住民的小孩 我門必須付出更多的努力\r\n如果我門是原住民的小孩 加油再加油\r\n\r\nA1\r\n深記在心中的不滿 現在外面的生活 不是爭瘋相對 就是騙到飽\r\n每當我打開電視都會讓我很難過 人的行為已經走樣了\r\n戰爭 殺人 吸食毒品 等樣樣都來\r\n尤其是我門現代的年輕人生活當成拍電影嘴裡聽不到一句母語\r\n只要還有呼吸的一天就會飆車械鬥再來家長收拾好像賺錢很容易\r\n垃圾的行為 什麼時候改邪歸正 還是大家喜歡這樣下去呢\r\n只要我門懂的愛懂的包容 也許生活會好一些\r\n\r\n(副歌)\r\nA2\r\n朋友 真的假的 學一些虛情假意的東西 誰教你們這麼做的\r\n認真一點 學一些虛情假意的東西 誰教你們這麼做的\r\n\r\n\r\n各位垃圾從以前長輩都把我門保護的很好\r\n希望我門都平安順利能夠一層一層的往上爬\r\n做晚輩的要懂的尊敬長輩 做長輩的要懂的照顧晚輩\r\n不要在爭瘋相對\r\n人不要懶惰壞事不要再繼續 好好聽老人家的話\r\n不要再喝酒 不要打架 健壯的身體不應該用在這種事上\r\n如果有聽到就快點清醒 時間是不等人的\r\n你想說什麼 妳要說什麼\r\n\r\n(副歌)\r\nA3\r\n朋友 真的假的 學一些虛情假意的東西 誰教你們這麼做的\r\n認真一點 學一些虛情假意的東西 誰教你們這麼做的\r\n\r\n也許你們對我的發言覺得很煩 全都是從屁股出來的言語\r\n臭臭的噁心的就像放屁 人聽到頭一定很痛是吧\r\n別以為我喜歡在這說廢話 廢物就要用廢話來教\r\n如果你不想聽 就把耳朵僿住 只要我不符的一天\r\n就會一直說下去\r\n用心想想我門自從到底要的是什麼 我就不相信大家喜歡過正種生活\r\n如果你認同我的說法請舉起你的右手跟我一起往前走\r\n(副歌)\r\n喔~喔~喔 YA YA YA YA\r\n\r\n如果我門是原住民的小孩 我門必須付出更多的努力\r\n如果我門是原住民的小孩 加油再加油 ', '', 241, '', '黃克雄.杜王雄.杜凱文', '黃克雄', '黃克雄', '文樂鷹族', '', 0, 0, 1, '2011-02-16 15:19:51', '2013-10-07 17:18:06', '0000-00-00 00:00:00'),
