(32968, 61040, 0, 1, '貓眼（Live）', '', '2011-02-16 00:00:00', 2000, 0, 2, 7, '閉上眼   誰都不被誰看見\r\n繞個圈   她裙襬撫過床沿\r\n高跟鞋   在波斯地毯纏綿\r\n迷濛間   此刻你為誰暈眩\r\n\r\n慾望  若隱  若現\r\n迷幻  絕艷  緋夜\r\n倨傲的誘惑在胸口燃燒刺痛讓你難忍試煉\r\n你為求她的垂愛願意順從她所有任性差遣...\r\n\r\n攀上肩   髮香在耳邊廝繾\r\n瞇眼簾   你低頭微笑沉醉\r\n窗紗前   分不清嬌憐虛偽\r\n推開臉   野貓一般的戲謔\r\n\r\n裸足  漫舞  旖魅\r\n髮際　香汗  蔓延　\r\n無法抵抗束手任黑色蕾絲纏繞你想像空間\r\n溫潤耳語緊繃感官神經蓄勢就像蒼鷹盤旋...\r\n\r\n火熱  吻過  指尖\r\n理智  淪陷  崩潰\r\n雕鏤鏡臺看見道德凐滅在你心中那黑暗面\r\n她瞇起貓眼轉身躍開失去興趣對你已不屑...\r\n', '', 231, '', 'Kristin', '二爺', '', '', '', 0, 0, 1, '2011-02-16 22:58:30', '2013-10-07 17:18:07', '0000-00-00 00:00:00'),
