(32982, 92805, 0, 1, '愛情陷阱', '', '2011-02-16 00:00:00', 2000, 0, 2, 4, '想法變了太多 是否 該停止\r\n\r\n你說你沒有感覺 對於我\r\n\r\n可能 這是你早就想 要對我說\r\n\r\n的話 只是放在心裡很久了沒有說\r\n\r\n\r\n爭吵也開始變得很 平凡\r\n\r\n歡笑 相對變得很少\r\n\r\n如今 你說要分還是和都讓我來挑\r\n\r\n我決定要選擇 分的毒藥\r\n\r\n\r\n我選擇逃避\r\n\r\n逃離你給的陷阱\r\n\r\n不再次陷入夢裡\r\n\r\n讓你狠狠括我的心\r\n\r\n\r\n我決定離去\r\n\r\n遠走去沒你的天際\r\n\r\n我選擇逃避\r\n\r\n我決定離開你 後遠去', '', 301, '', '潘信維(Pam.s.w)', '潘信維(Pam.s.w)', '潘信維(Pam.s.w)', '潘信維(Pam.s.w)', '', 0, 0, 1, '2011-02-16 23:54:55', '2013-10-07 17:18:07', '0000-00-00 00:00:00'),
