(32985, 17068, 0, 1, '光榮時刻', '如果在到處玩樂之餘，\r\n還能將沿途的心情變成音符帶回家，那真是幸福。\r\n2010夏初Woodys到了墾丁，\r\n剛好四年一度世界杯足球賽的賽事，\r\n這首歌因此誕生。\r\n\r\n描寫足球員在經歷各種辛苦的訓練與自律之後，\r\n進球時的心情。\r\n\r\n3拍的曲子，穿差重拍落點不一樣的小節，間奏轉為5拍。\r\n令人振奮前進。', '2011-02-17 00:00:00', 2000, 0, 1, 7, '', '', 220, '', 'WoodyWoody', '', '', '', '', 1, 1, 0, '2011-02-17 00:23:34', '2015-03-12 13:46:01', '0000-00-00 00:00:00'),
(32986, 82406, 0, 1, '獨自對白', '陌客(Moker)樂團 自創曲', '2011-02-17 00:00:00', 2000, 0, 2, 4, '我們這樣繼續好嗎\r\n心慌得像失去了方向\r\n如果愛你 儘管受傷\r\n要繼續愛的大方\r\n\r\n你是愛我的呀\r\n卻看見你幫她撐著傘\r\n如果愛你 容易受傷\r\n我會替自己傷口畫點妝\r\n\r\n就算獨自面對黑暗我也不會害怕\r\n因為沒有你在身旁我早已經習慣\r\n倚著鐵窗\r\n自作自受地遍體鱗傷\r\n\r\n相信你是愛我的呀\r\n就算你迷戀她的廚房\r\n我會告訴自己那都是假象\r\n忘記一切故作堅強\r\n\r\n該是時候放下了吧\r\n你不會再心疼我的傷', '', 237, '', '陌客(Moker)樂團', 'LISA', '陌客(Moker)樂團', '陌社辦', '', 0, 0, 1, '2011-02-17 01:38:03', '2013-10-07 17:18:07', '0000-00-00 00:00:00'),
