(33019, 98121, 0, 1, '文樂村豐年祭', '~文樂村豐年祭~\r\n\r\n文樂村來自屏東縣來義鄉的部落\r\n原住民部落名稱叫~布族努克~\r\n我們的豐年祭典固定於每年國曆8月15-17日三天\r\n每到這祭典時~我們各年齡層村民都有各自所期待的活動~\r\n1.老年人~期待著~祭侍祖先儀式\r\n2.中年人~期待著~傳統競技比賽\r\n3.年輕人~期待著~送情材(本村獨特文化)\r\n4.青少年~期待著~跳大會舞(傳統山地舞)找心儀的對象\r\n~~等等各項活動~\r\n朋友們~想來參與我們的豐年嗎??', '2011-01-01 00:00:00', 2000, 0, 2, 2, '~歌詞大意~\r\n\r\n文樂現在這麼大ㄉ太陽 \r\n好像有跳蚤在背後咬\r\n我要去山上砍一台卡車ㄉ木材\r\n送給我心儀的對象叫 (哈哈)\r\n你看有 比腕力 有推竹竿 有摔角 有射弓箭比賽\r\n只要有這些活動 就知道豐年祭到了\r\n\r\nSI LI SI 很久以前的 走大家一起去參加\r\n\r\n我看到夫夫走在路上\r\n響亮ㄉ排灣族服飾\r\n走到聚會場所要跳傳統ㄉ山地舞\r\n男男女女和樂無比\r\n夫夫也跟我分享了以前\r\n只要到了豐年祭ㄉ故事\r\n吃著烤豬肉 喝著小米酒 \r\n這是我門美麗ㄉ文樂部落\r\n\r\nSI LI SI 從很久以前的 走大家一起去參加\r\n\r\n這是從文樂部落來的 從南邊跳到西邊\r\n喔~~~豐年祭又到了 喔~~~豐年祭又到了 \r\n喔~~~豐年祭又到了 喔~~~豐年祭又到了 \r\nC G Am F(反覆運用哈哈哈哈哈).', '', 292, '', 'SE樂團', '黃克雄', '黃克雄', '文樂鷹族', '', 0, 0, 1, '2011-02-17 11:28:09', '2013-10-07 17:18:07', '0000-00-00 00:00:00'),
